import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Navigation.css';
const SideMenu = () => {
    return (
        <div>
            <ul className="navbarMenu">
                <Link to="/account">
                <li>
                    Account
                </li>
                </Link>
                <Link to="/">
                <li>
                    Logout
                </li>
                </Link>
            </ul> 
        </div>
    );
};

export default SideMenu;
